import React from "react";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";
import { useLocation } from "react-router-dom";
import { createTheme, ThemeProvider, styled } from "@mui/material/styles";

const VehicleStatus = () => {
  const { pathname } = useLocation();
  const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    textAlign: "h3",
    color: theme.palette.text.secondary,
    height: 60,
    lineHeight: "60px",
  }));
  const lightTheme = createTheme({ palette: { mode: "light" } });
  const statusArr ={
    elevation:"200m",
    temperature:"30c",
    locked:false,
    battery:"75.6%",
    throttle:true,
    controller:true,
    motor:true,
    overload:true,
    overcurrent:true,
}

  return (
    <div>
      <div
        style={{
          margin: "20px",
        }}
      >
        Vehicle &gt; {pathname.slice(1, 6)}
      </div>
      <h3>vehicle status</h3>
      <Grid container spacing={2}>
        {[lightTheme].map((theme, index) => (
          <Grid item xs={6} key={index}>
            <ThemeProvider theme={theme}>
              <Box
                sx={{
                  p: 2,
                  bgcolor: "#DFDFDE",
                  display: "grid",
                  gridTemplateColumns: { md: "200px 200px" },
                  gridTemplateRows: { md: "50px 50px 50px 50px" },
                  gap: 2,
                  height: "220px",
                  width: "450px",
                  borderRadius: "2px",
                }}
              >
                {/* {statusArr.map((elevation,key) =>(
                  <Item key={key} elevation={0}>
                    {`   ${elevation[key]}`}
                  </Item>
                ))} */}

                <div style={
                  {
                    display:"flex",
                    flexDirection:"row"
                  }
                }>
                <div style={{
                  display:"flex",
                  flexDirection:"column"
                }}>
                  <span>{statusArr.elevation}</span>
                  <span>{statusArr.temperature}</span>
                  <span>{statusArr.locked}</span>
                  <span>{statusArr.battery}</span>
                </div>
                <div style={{
                  display:"flex",
                  flexDirection:"column"
                }}>
                  <span>{statusArr.throttle}</span>
                  <span>{statusArr.controller}</span>
                  <span>{statusArr.motor}</span>
                  <span>{statusArr.overload}</span>
                  <span>{statusArr.overcurrent}</span>
                </div>
                </div>
              </Box>
            </ThemeProvider>
          </Grid>
        ))}
      </Grid>
    </div>
  );
};

export default VehicleStatus;
